    public void Dificuldade(int d)
    {
        int fac;
        bool playdif = true;
        int RandomNumber;
        System.Random Rnbr = new System.Random();

        if (d == 0)
        {
            Debug.Log("facil");
            fac = 0;
            RandomNumber = Rnbr.Next(27, 30);
            while (playdif)
            {
                for (int i = 0; i < 9; i++)
                {
                    for (int j = 0; j < 9; j++)
                    {
                        int ale = rnd.Next(0, 10);
                        if (ale%4 == 0)
                            Tab2[i, j] = 0;
                        Debug.Log(fac);
                        if (Tab2[i, j] == 0)
                            fac++;
                        if (fac > RandomNumber)
                        {
                            i = 9;
                            j = 9;
                            playdif = false;
                        }
                    }
                }
            }
        }
        else
        {
            if (d == 1)
            {
                Debug.Log("medio");
                fac = 0;
                RandomNumber = Rnbr.Next(30, 50);
                while (playdif)
                {
                    for (int i = 0; i < 9; i++)
                    {
                        for (int j = 0; j < 9; j++)
                        {
                            int ale = rnd.Next(0, 2);
                            Debug.Log(fac);
                            if (ale == 0)
                                Tab2[i, j] = 0;
                            if (Tab2[i, j] == 0)
                                fac++;
                            if (fac > RandomNumber)
                            {
                                i = 9;
                                j = 9;
                                playdif = false;
                            }
                        }
                    }
                }
            }
            else
            {

                if (d == 2)
                {
                    fac = 0;
                    RandomNumber = Rnbr.Next(50, 60);
                    Debug.Log("Dificil");
                    while (playdif)
                    {
                        for (int i = 0; i < 9; i++)
                        {
                            for (int j = 0; j < 9; j++)
                            {
                                Debug.Log(fac);
                                int ale = rnd.Next(0, 2);
                                if (ale == 0)
                                    Tab2[i, j] = 0;
                                if (Tab2[i, j] == 0)
                                {
                                    fac++;
                                    if (fac > RandomNumber)
                                    {
                                        playdif = false;
                                        j = 9;
                                        i = 9;
                                    }
                                }
                            }
                        }
                    }
                }
            }
        }
        dificuldades.SetActive(false);
        tabuleiro.SetActive(true);
        ativo = true;

    }

